import React, { Component } from "react";


export default class Index extends Component {

    render() {
      return (

          <div className="containme bg-red bg-ellipses">
                  <div className="container-fluid">
                    <div className="row justify-content-center">
                      <div className="col-md-10 col-lg-10 col-xl-8">
                        <h1 className="display-3 text-center text-white">
                          Number Theory, Combinatorics, &amp; Special Functions
                        </h1>
                        <p className="lead text-center text-white">
                        Conference in honour of 70th birthday of Prof. A. K. Agarwal<br></br>
                        Symposia on Applied Mathematics and Engg. Applications
                        </p>

                      </div>
                    </div>
                  </div>
                </div>
    );
      }}
